import React from 'react'
import Button from '@material-ui/core/Button'
import Particles from 'react-particles-js'
import Grid from '@material-ui/core/Grid'

const particleOpt = {
    polygon: {
      enable: true,
      type: 'inside',
      move: {
          radius: 10
      },
      url: 'anatomy.svg'
  }
}

function Index(props) {
    return (
      <React.Fragment>
        <Particles canvasClassName="particle-canvas" canvasClassName="example"
                height="120px"
                width="300px" params={particleOpt} />
        <Grid className="wrapper" item xs={6} sm container>
          <div className="introduction">
            <hgroup>
              <h1 className="hello">Hello, I'm <span>Maicon Esteves</span>.</h1>
              <h2 className="hello">I'm a full-stack developer.</h2>
            </hgroup>
          <Button variant="outlined" size="large" color="secondary" href="home">Default</Button>
          </div>
        </Grid>
      </React.Fragment>
    );
}

export default Index
